    //       h
    //     </span>
    //   </div> */}
    // </div>
    <div className="flex">
      <div className="hidden h-[17rem] w-[15rem] items-end justify-center px-[4rem] md:flex">
        <Filter />
      </div>
      <div className=" flex flex-col">
        <Header />
        <div className=" mt-[5rem] flex flex-col gap-3">
          <Cardbar />
          <Cards />
        </div>
      </div>
      <div className="w-[25rem]"></div>
    </div>
  );
};

export default Main;
